import { Container, Row, Col, Card, Button } from 'react-bootstrap';

function Headphones() {


    return ( 
        <>
        <Container style={{marginTop:"50px"}}>
            <Row>
                <Col style={{
                    "margin":"0",
                    top:"50%",
                    display:"flex",
                    justifyContent:"center",
                    alignItems:"center"
                }}>
                <Card style={{ width: '35rem' }}>
                 <Card.Img 
                 variant="top" 
                 style={{objectFit:"cover"}}
                 src="https://images.unsplash.com/photo-1600086827875-a63b01f1335c?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1548&q=80" />
             </Card>
                </Col>
                <Col style={{
                    "margin":"0",
                    top:"50%",
                    display:"flex",
                    justifyContent:"center",
                    alignItems:"center"
                }}>

                <p> 
                <h2 style={{marginBottom:"15px"}}>XX99 Mark II Headphones</h2>
                The new XX99 Mark II headphones is the pinnacle of pristine audio. It redefines your premium headphone experience by reproducing the balanced depth and precision of studio-quality sound.
                <Button variant='dark' size="lg" style={{backgroundColor:"#d87d4a"}}> 0.02 ETH</Button>
                </p>
                </Col>
            </Row>
        </Container>
        </>
     );
}

export default Headphones;
